import './button.styles.scss';

const Button_Types_Class = {
  google: "google-sign-in",
  inverted: "inverted",
};

const Button = ({ children, buttonType, ...otherPropes }) => {
  return (

      <button
        className={`button-container ${Button_Types_Class[buttonType]}`}
        {...otherPropes}
      >
        {children}
      </button>

  );
};

export default Button;
